import React from 'react';
import CopyToClipboard from 'react-copy-to-clipboard';

function Body(){
const text="Hi this is react body"
    return (
      <div className='container'>
          <input type="text" name="name" value={text} />
          <button onClick={() => {
            navigator.clipboard.writeText(text);
          }}>Copy</button>
      </div>
  )
}



export default Body
